// MEDIUM

// You are given an undirected weighted graph of n nodes (0-indexed), represented by an edge list where edges[i] = [a, b] is an undirected edge connecting the nodes a and b with a probability of success of traversing that edge succProb[i].

// Given two nodes start and end, find the path with the maximum probability of success to go from start to end and return its success probability.

// If there is no path from start to end, return 0. Your answer will be accepted if it differs from the correct answer by at most 1e-5.

function maxProbability(n: number, edges: number[][], succProb: number[], start_node: number, end_node: number): number {
    // probabilites (distances) list, higher is better, 0 = infinite/impossible
    let probabilities:number[] = Array.from({length: n}, () => 0);
    probabilities[start_node] = 1;
    let visited = new Set<number>();

    while (visited.size < n) {
        let currentVertex:number;
        let highestProbability = 0;
        for (let i = 0; i<n; i++) {
            if (!(visited.has(i)) && probabilities[i] > highestProbability) {
                highestProbability = probabilities[i];
                currentVertex = i;
            }
        }
        // console.log("visiting " + currentVertex + " as " + visited.size);
        // if currentVertex wasn't defined that means that all possible vertices were visited even if that means that not all vertices were visited
        if (currentVertex == undefined) {
            break;
        }

        visited.add(currentVertex);
        // for each neighbor of the current vertex
        for (let i=0; i<edges.length; i++) {
            if (edges[i][0] == currentVertex || edges[i][1] == currentVertex) {
                let neighbor:number;
                if (edges[i][0] == currentVertex)
                    neighbor = edges[i][1];
                else
                    neighbor = edges[i][0];
                const weight = succProb[i];
                const totalDistance = probabilities[currentVertex] * weight;
                if (totalDistance > probabilities[neighbor]) {
                    probabilities[neighbor] = totalDistance;
                }
            }
        }
    }

    return probabilities[end_node];
};

